import React, { useContext } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Grid,
  Card,
  CardContent,
  CardActions,
  Typography,
  Button,
  Box,
  Paper,
  IconButton,
} from '@mui/material';
import {
  LocalFlorist as PlantIcon,
  Article as LogIcon,
  Add as AddIcon,
  Visibility as ViewIcon,
} from '@mui/icons-material';
import { UserContext } from '../contexts/UserContext';

const Dashboard = () => {
  const navigate = useNavigate();
  const { user } = useContext(UserContext);

  const dashboardCards = [
    {
      title: 'Interactive Garden Canvas',
      description: 'Place plants visually and log daily metrics (EC, pH, temperature, humidity)',
      icon: <AddIcon sx={{ fontSize: 40, color: 'primary.main' }} />,
      actions: [
        { label: 'Open Canvas', onClick: () => navigate('/canvas'), icon: <ViewIcon /> },
      ],
      featured: true,
    },
    {
      title: 'My Plants',
      description: 'View and manage your plant collection',
      icon: <PlantIcon sx={{ fontSize: 40, color: 'primary.main' }} />,
      actions: [
        { label: 'View Plants', onClick: () => navigate('/plants'), icon: <ViewIcon /> },
      ],
    },
    {
      title: 'Garden Logs',
      description: 'Track your gardening activities and progress',
      icon: <LogIcon sx={{ fontSize: 40, color: 'secondary.main' }} />,
      actions: [
        { label: 'View Logs', onClick: () => navigate('/logs'), icon: <ViewIcon /> },
      ],
    },
  ];

  return (
    <Box>
      <Paper elevation={1} sx={{ p: 3, mb: 4, background: 'linear-gradient(135deg, #e8f5e8 0%, #f1f8e9 100%)' }}>
        <Typography variant="h4" component="h1" gutterBottom sx={{ color: 'primary.dark' }}>
          Welcome to Your Garden Dashboard
        </Typography>
        <Typography variant="body1" color="textSecondary">
          Hello {user?.name || user?.email}! Manage your plants and track your gardening journey.
        </Typography>
      </Paper>

      <Grid container spacing={3}>
        {dashboardCards.map((card, index) => (
          <Grid item xs={12} md={card.featured ? 12 : 6} key={index}>
            <Card 
              elevation={card.featured ? 6 : 3} 
              sx={{ 
                height: '100%', 
                display: 'flex', 
                flexDirection: 'column',
                transition: 'transform 0.2s',
                '&:hover': { transform: 'translateY(-4px)' },
                ...(card.featured && {
                  background: 'linear-gradient(135deg, #e8f5e8 0%, #c8e6c9 100%)',
                  border: '2px solid #4caf50'
                })
              }}
            >
              <CardContent sx={{ flexGrow: 1, textAlign: 'center', pt: 3 }}>
                <Box sx={{ mb: 2 }}>
                  {card.icon}
                </Box>
                <Typography variant="h5" component="h2" gutterBottom>
                  {card.title}
                </Typography>
                <Typography variant="body2" color="textSecondary">
                  {card.description}
                </Typography>
              </CardContent>
              <CardActions sx={{ justifyContent: 'center', pb: 2 }}>
                {card.actions.map((action, actionIndex) => (
                  <Button
                    key={actionIndex}
                    variant="contained"
                    startIcon={action.icon}
                    onClick={action.onClick}
                    sx={{ mr: 1 }}
                  >
                    {action.label}
                  </Button>
                ))}
              </CardActions>
            </Card>
          </Grid>
        ))}
      </Grid>

      <Box sx={{ mt: 4 }}>
        <Paper elevation={2} sx={{ p: 3 }}>
          <Typography variant="h6" gutterBottom sx={{ color: 'primary.dark' }}>
            Canvas Usage Tips 🎯
          </Typography>
          <Typography variant="body2" paragraph>
            • <strong>Add Plants:</strong> Click anywhere on the canvas to place a new plant at that location
          </Typography>
          <Typography variant="body2" paragraph>
            • <strong>Log Metrics:</strong> Click on any existing plant to record daily EC, pH, temperature, and humidity values
          </Typography>
          <Typography variant="body2" paragraph>
            • <strong>Track Growth:</strong> Use the visual layout to understand plant spacing and monitor your garden's development
          </Typography>
          <Typography variant="body2">
            • <strong>Daily Routine:</strong> Make it a habit to log at least pH and EC daily for optimal plant health monitoring
          </Typography>
        </Paper>
      </Box>
    </Box>
  );
};

export default Dashboard;
